def edges_to_children_dict(edges):
    """
    将边列表转换为 {节点: [子节点列表]} 的字典。
    输入的每条边格式为 (parent, child)。

    返回值：
        dict: {node: [children]}
    """
    # 收集所有出现过的节点
    nodes = set()
    for p, c in edges:
        nodes.add(p)
        nodes.add(c)

    # 初始化每个节点
    children_dict = {node: [] for node in nodes}

    # 填充子节点
    for parent, child in edges:
        children_dict[parent].append(child)

    return children_dict

