        fdr_list=[]
        f1_list=[]
        for m in [edges1,edges2,edges3,edges4]:
            
            num_samples = 1000
            data=dg.generate_data_with_causal_and_autocorrelation(m, num_samples, noise_std=0.4,lag=tl)
